pub enum Meta {
    Path(Path),

    /// A structured list within an attribute, like `derive(Copy, Clone)`.
    List(MetaList),

    /// A name-value pair within an attribute, like `feature = "nightly"`.
    NameValue(MetaNameValue),
}

pub enum NestedMeta {

    /// A structured meta item, like the `Copy` in `#[derive(Copy)]` which
    /// would be a nested `Meta::Path`.
    Meta(Meta),

    /// A Rust literal, like the `"new_name"` in `#[rename("new_name")]`.
    Lit(Lit),
}

pub enum Fields {

    /// Named fields of a struct or struct variant such as `Point { x: f64,
    /// y: f64 }`.
    Named(FieldsNamed),

    /// Unnamed fields of a tuple struct or tuple variant such as `Some(T)`.
    Unnamed(FieldsUnnamed),

    /// Unit struct or unit variant such as `None`.
    Unit,
}

pub enum Visibility {

    /// A public visibility level: `pub`.
    Public(VisPublic),

    /// A crate-level visibility: `crate`.
    Crate(VisCrate),

    /// A visibility level restricted to some path: `pub(self)` or
    /// `pub(super)` or `pub(crate)` or `pub(in some::module)`.
    Restricted(VisRestricted),

    /// An inherited visibility, which usually means private.
    Inherited,
}

pub enum Expr {

    /// A slice literal expression: `[a, b, c, d]`.
    Array(ExprArray),

    /// An assignment expression: `a = compute()`.
    Assign(ExprAssign),

    /// A compound assignment expression: `counter += 1`.
    AssignOp(ExprAssignOp),

    /// An async block: `async { ... }`.
    Async(ExprAsync),

    /// An await expression: `fut.await`.
    Await(ExprAwait),

    /// A binary operation: `a + b`, `a * b`.
    Binary(ExprBinary),

    /// A blocked scope: `{ ... }`.
    Block(ExprBlock),

    /// A box expression: `box f`.
    Box(ExprBox),

    /// A `break`, with an optional label to break and an optional
    /// expression.
    Break(ExprBreak),

    /// A function call expression: `invoke(a, b)`.
    Call(ExprCall),

    /// A cast expression: `foo as f64`.
    Cast(ExprCast),

    /// A closure expression: `|a, b| a + b`.
    Closure(ExprClosure),

    /// A `continue`, with an optional label.
    Continue(ExprContinue),

    /// Access of a named struct field (`obj.k`) or unnamed tuple struct
    /// field (`obj.0`).
    Field(ExprField),

    /// A for loop: `for pat in expr { ... }`.
    ForLoop(ExprForLoop),

    /// An expression contained within invisible delimiters.
    ///
    /// This variant is important for faithfully representing the precedence
    /// of expressions and is related to `None`-delimited spans in a
    /// `TokenStream`.
    Group(ExprGroup),

    /// An `if` expression with an optional `else` block: `if expr { ... }
    /// else { ... }`.
    ///
    /// The `else` branch expression may only be an `If` or `Block`
    /// expression, not any of the other types of expression.
    If(ExprIf),

    /// A square bracketed indexing expression: `vector[2]`.
    Index(ExprIndex),

    /// A `let` guard: `let Some(x) = opt`.
    Let(ExprLet),

    /// A literal in place of an expression: `1`, `"foo"`.
    Lit(ExprLit),

    /// Conditionless loop: `loop { ... }`.
    Loop(ExprLoop),

    /// A macro invocation expression: `format!("{}", q)`.
    Macro(ExprMacro),

    /// A `match` expression: `match n { Some(n) => {}, None => {} }`.
    Match(ExprMatch),

    /// A method call expression: `x.foo::<T>(a, b)`.
    MethodCall(ExprMethodCall),

    /// A parenthesized expression: `(a + b)`.
    Paren(ExprParen),

    /// A path like `std::mem::replace` possibly containing generic
    /// parameters and a qualified self-type.
    ///
    /// A plain identifier like `x` is a path of length 1.
    Path(ExprPath),

    /// A range expression: `1..2`, `1..`, `..2`, `1..=2`, `..=2`.
    Range(ExprRange),

    /// A referencing operation: `&a` or `&mut a`.
    Reference(ExprReference),

    /// An array literal constructed from one repeated element: `[0u8; N]`.
    Repeat(ExprRepeat),

    /// A `return`, with an optional value to be returned.
    Return(ExprReturn),

    /// A struct literal expression: `Point { x: 1, y: 1 }`.
    ///
    /// The `rest` provides the value of the remaining fields as in `S { a:
    /// 1, b: 1, ..rest }`.
    Struct(ExprStruct),

    /// A try-expression: `expr?`.
    Try(ExprTry),

    /// A try block: `try { ... }`.
    TryBlock(ExprTryBlock),

    /// A tuple expression: `(a, b, c, d)`.
    Tuple(ExprTuple),

    /// A type ascription expression: `foo: f64`.
    Type(ExprType),

    /// A unary operation: `!x`, `*x`.
    Unary(ExprUnary),

    /// An unsafe block: `unsafe { ... }`.
    Unsafe(ExprUnsafe),

    /// Tokens in expression position not interpreted by Syn.
    Verbatim(TokenStream),

    /// A while loop: `while expr { ... }`.
    While(ExprWhile),

    /// A yield expression: `yield expr`.
    Yield(ExprYield),

    #[doc(hidden)]
    __Nonexhaustive,
}

pub enum Member {

    /// A named field like `self.x`.
    Named(Ident),

    /// An unnamed field like `self.0`.
    Unnamed(Index),
}

pub enum GenericMethodArgument {

    /// A type argument.
    Type(Type),

    /// A const expression. Must be inside of a block.
    ///
    /// NOTE: Identity expressions are represented as Type arguments, as
    /// they are indistinguishable syntactically.
    Const(Expr),
}

pub enum RangeLimits {

    /// Inclusive at the beginning, exclusive at the end.
    HalfOpen(crate::token::Dot2),

    /// Inclusive at the beginning and end.
    Closed(crate::token::DotDotEq),
}

pub enum GenericParam {

    /// A generic type parameter: `T: Into<String>`.
    Type(TypeParam),

    /// A lifetime definition: `'a: 'b + 'c + 'd`.
    Lifetime(LifetimeDef),

    /// A const generic parameter: `const LENGTH: usize`.
    Const(ConstParam),
}

pub enum WherePredicate {

    /// A type predicate in a `where` clause: `for<'c> Foo<'c>: Trait<'c>`.
    Type(PredicateType),

    /// A lifetime predicate in a `where` clause: `'a: 'b + 'c`.
    Lifetime(PredicateLifetime),

    /// An equality predicate in a `where` clause (unsupported).
    Eq(PredicateEq),
}

pub enum Item {

    /// A constant item: `const MAX: u16 = 65535`.
    Const(ItemConst),

    /// An enum definition: `enum Foo<A, B> { A(A), B(B) }`.
    Enum(ItemEnum),

    /// An `extern crate` item: `extern crate serde`.
    ExternCrate(ItemExternCrate),

    /// A free-standing function: `fn process(n: usize) -> Result<()> { ...
    /// }`.
    Fn(ItemFn),

    /// A block of foreign items: `extern "C" { ... }`.
    ForeignMod(ItemForeignMod),

    /// An impl block providing trait or associated items: `impl<A> Trait
    /// for Data<A> { ... }`.
    Impl(ItemImpl),

    /// A macro invocation, which includes `macro_rules!` definitions.
    Macro(ItemMacro),

    /// A 2.0-style declarative macro introduced by the `macro` keyword.
    Macro2(ItemMacro2),

    /// A module or module declaration: `mod m` or `mod m { ... }`.
    Mod(ItemMod),

    /// A static item: `static BIKE: Shed = Shed(42)`.
    Static(ItemStatic),

    /// A struct definition: `struct Foo<A> { x: A }`.
    Struct(ItemStruct),

    /// A trait definition: `pub trait Iterator { ... }`.
    Trait(ItemTrait),

    /// A trait alias: `pub trait SharableIterator = Iterator + Sync`.
    TraitAlias(ItemTraitAlias),

    /// A type alias: `type Result<T> = std::result::Result<T, MyError>`.
    Type(ItemType),

    /// A union definition: `union Foo<A, B> { x: A, y: B }`.
    Union(ItemUnion),

    /// A use declaration: `use std::collections::HashMap`.
    Use(ItemUse),

    /// Tokens forming an item not interpreted by Syn.
    Verbatim(TokenStream),

    #[doc(hidden)]
    __Nonexhaustive,
}

pub enum UseTree {

    /// A path prefix of imports in a `use` item: `std::...`.
    Path(UsePath),

    /// An identifier imported by a `use` item: `HashMap`.
    Name(UseName),

    /// An renamed identifier imported by a `use` item: `HashMap as Map`.
    Rename(UseRename),

    /// A glob import in a `use` item: `*`.
    Glob(UseGlob),

    /// A braced group of imports in a `use` item: `{A, B, C}`.
    Group(UseGroup),
}

pub enum ForeignItem {

    /// A foreign function in an `extern` block.
    Fn(ForeignItemFn),

    /// A foreign static item in an `extern` block: `static ext: u8`.
    Static(ForeignItemStatic),

    /// A foreign type in an `extern` block: `type void`.
    Type(ForeignItemType),

    /// A macro invocation within an extern block.
    Macro(ForeignItemMacro),

    /// Tokens in an `extern` block not interpreted by Syn.
    Verbatim(TokenStream),

    #[doc(hidden)]
    __Nonexhaustive,
}

pub enum TraitItem {

    /// An associated constant within the definition of a trait.
    Const(TraitItemConst),

    /// A trait method within the definition of a trait.
    Method(TraitItemMethod),

    /// An associated type within the definition of a trait.
    Type(TraitItemType),

    /// A macro invocation within the definition of a trait.
    Macro(TraitItemMacro),

    /// Tokens within the definition of a trait not interpreted by Syn.
    Verbatim(TokenStream),

    #[doc(hidden)]
    __Nonexhaustive,
}

pub enum ImplItem {

    /// An associated constant within an impl block.
    Const(ImplItemConst),

    /// A method within an impl block.
    Method(ImplItemMethod),

    /// An associated type within an impl block.
    Type(ImplItemType),

    /// A macro invocation within an impl block.
    Macro(ImplItemMacro),

    /// Tokens within an impl block not interpreted by Syn.
    Verbatim(TokenStream),

    #[doc(hidden)]
    __Nonexhaustive,
}

pub enum FnArg {

    /// The `self` argument of an associated method, whether taken by value
    /// or by reference.
    ///
    /// Note that `self` receivers with a specified type, such as `self:
    /// Box<Self>`, are parsed as a `FnArg::Typed`.
    Receiver(Receiver),

    /// A function argument accepted by pattern and type.
    Typed(PatType),
}

pub enum Lit {

    /// A UTF-8 string literal: `"foo"`.
    Str(LitStr),

    /// A byte string literal: `b"foo"`.
    ByteStr(LitByteStr),

    /// A byte literal: `b'f'`.
    Byte(LitByte),

    /// A character literal: `'a'`.
    Char(LitChar),

    /// An integer literal: `1` or `1u16`.
    Int(LitInt),

    /// A floating point literal: `1f64` or `1.0e10f64`.
    ///
    /// Must be finite. May not be infinte or NaN.
    Float(LitFloat),

    /// A boolean literal: `true` or `false`.
    Bool(LitBool),

    /// A raw token literal not interpreted by Syn.
    Verbatim(Literal),
}

pub enum StrStyle {

    /// An ordinary string like `"data"`.
    Cooked,

    /// A raw string like `r##"data"##`.
    ///
    /// The unsigned integer is the number of `#` symbols used.
    Raw(usize),
}

pub enum Data {

    /// A struct input to a `proc_macro_derive` macro.
    Struct(DataStruct),

    /// An enum input to a `proc_macro_derive` macro.
    Enum(DataEnum),

    /// An untagged union input to a `proc_macro_derive` macro.
    Union(DataUnion),
}

pub enum BinOp {

    /// The `+` operator (addition)
    Add(crate::token::Add),

    /// The `-` operator (subtraction)
    Sub(crate::token::Sub),

    /// The `*` operator (multiplication)
    Mul(crate::token::Star),

    /// The `/` operator (division)
    Div(crate::token::Div),

    /// The `%` operator (modulus)
    Rem(crate::token::Rem),

    /// The `&&` operator (logical and)
    And(crate::token::AndAnd),

    /// The `||` operator (logical or)
    Or(crate::token::OrOr),

    /// The `^` operator (bitwise xor)
    BitXor(crate::token::Caret),

    /// The `&` operator (bitwise and)
    BitAnd(crate::token::And),

    /// The `|` operator (bitwise or)
    BitOr(crate::token::Or),

    /// The `<<` operator (shift left)
    Shl(crate::token::Shl),

    /// The `>>` operator (shift right)
    Shr(crate::token::Shr),

    /// The `==` operator (equality)
    Eq(crate::token::EqEq),

    /// The `<` operator (less than)
    Lt(crate::token::Lt),

    /// The `<=` operator (less than or equal to)
    Le(crate::token::Le),

    /// The `!=` operator (not equal to)
    Ne(crate::token::Ne),

    /// The `>=` operator (greater than or equal to)
    Ge(crate::token::Ge),

    /// The `>` operator (greater than)
    Gt(crate::token::Gt),

    /// The `+=` operator
    AddEq(crate::token::AddEq),

    /// The `-=` operator
    SubEq(crate::token::SubEq),

    /// The `*=` operator
    MulEq(crate::token::MulEq),

    /// The `/=` operator
    DivEq(crate::token::DivEq),

    /// The `%=` operator
    RemEq(crate::token::RemEq),

    /// The `^=` operator
    BitXorEq(crate::token::CaretEq),

    /// The `&=` operator
    BitAndEq(crate::token::AndEq),

    /// The `|=` operator
    BitOrEq(crate::token::OrEq),

    /// The `<<=` operator
    ShlEq(crate::token::ShlEq),

    /// The `>>=` operator
    ShrEq(crate::token::ShrEq),
}

pub enum UnOp {

    /// The `*` operator for dereferencing
    Deref(crate::token::Star),

    /// The `!` operator for logical inversion
    Not(crate::token::Bang),

    /// The `-` operator for negation
    Neg(crate::token::Sub),
}

pub enum Stmt {

    /// A local (let) binding.
    Local(Local),

    /// An item definition.
    Item(Item),

    /// Expr without trailing semicolon.
    Expr(Expr),

    /// Expression with trailing semicolon.
    Semi(Expr, crate::token::Semi),
}

pub enum Type {

    /// A fixed size array type: `[T; n]`.
    Array(TypeArray),

    /// A bare function type: `fn(usize) -> bool`.
    BareFn(TypeBareFn),

    /// A type contained within invisible delimiters.
    Group(TypeGroup),

    /// An `impl Bound1 + Bound2 + Bound3` type where `Bound` is a trait or
    /// a lifetime.
    ImplTrait(TypeImplTrait),

    /// Indication that a type should be inferred by the compiler: `_`.
    Infer(TypeInfer),

    /// A macro in the type position.
    Macro(TypeMacro),

    /// The never type: `!`.
    Never(TypeNever),

    /// A parenthesized type equivalent to the inner type.
    Paren(TypeParen),

    /// A path like `std::slice::Iter`, optionally qualified with a
    /// self-type as in `<Vec<T> as SomeTrait>::Associated`.
    Path(TypePath),

    /// A raw pointer type: `*const T` or `*mut T`.
    Ptr(TypePtr),

    /// A reference type: `&'a T` or `&'a mut T`.
    Reference(TypeReference),

    /// A dynamically sized slice type: `[T]`.
    Slice(TypeSlice),

    /// A trait object type `Bound1 + Bound2 + Bound3` where `Bound` is a
    /// trait or a lifetime.
    TraitObject(TypeTraitObject),

    /// A tuple type: `(A, B, C, String)`.
    Tuple(TypeTuple),

    /// Tokens in type position not interpreted by Syn.
    Verbatim(TokenStream),

    #[doc(hidden)]
    __Nonexhaustive,
}

pub enum ReturnType {

    /// Return type is not specified.
    ///
    /// Functions default to `()` and closures default to type inference.
    Default,

    /// A particular type is returned.
    Type(crate::token::RArrow, Box<Type>),
}

pub enum Pat {

    /// A box pattern: `box v`.
    Box(PatBox),

    /// A pattern that binds a new variable: `ref mut binding @ SUBPATTERN`.
    Ident(PatIdent),

    /// A literal pattern: `0`.
    ///
    /// This holds an `Expr` rather than a `Lit` because negative numbers
    /// are represented as an `Expr::Unary`.
    Lit(PatLit),

    /// A macro in pattern position.
    Macro(PatMacro),

    /// A pattern that matches any one of a set of cases.
    Or(PatOr),

    /// A path pattern like `Color::Red`, optionally qualified with a
    /// self-type.
    ///
    /// Unqualified path patterns can legally refer to variants, structs,
    /// constants or associated constants. Qualified path patterns like
    /// `<A>::B::C` and `<A as Trait>::B::C` can only legally refer to
    /// associated constants.
    Path(PatPath),

    /// A range pattern: `1..=2`.
    Range(PatRange),

    /// A reference pattern: `&mut var`.
    Reference(PatReference),

    /// The dots in a tuple or slice pattern: `[0, 1, ..]`
    Rest(PatRest),

    /// A dynamically sized slice pattern: `[a, b, ref i @ .., y, z]`.
    Slice(PatSlice),

    /// A struct or struct variant pattern: `Variant { x, y, .. }`.
    Struct(PatStruct),

    /// A tuple pattern: `(a, b)`.
    Tuple(PatTuple),

    /// A tuple struct or tuple variant pattern: `Variant(x, y, .., z)`.
    TupleStruct(PatTupleStruct),

    /// A type ascription pattern: `foo: f64`.
    Type(PatType),

    /// Tokens in pattern position not interpreted by Syn.
    Verbatim(TokenStream),

    /// A pattern that matches any value: `_`.
    Wild(PatWild),

    #[doc(hidden)]
    __Nonexhaustive,
}

pub enum PathArguments {
    None,

    /// The `<'a, T>` in `std::slice::iter<'a, T>`.
    AngleBracketed(AngleBracketedGenericArguments),

    /// The `(A, B) -> C` in `Fn(A, B) -> C`.
    Parenthesized(ParenthesizedGenericArguments),
}

pub enum GenericArgument {

    /// A lifetime argument.
    Lifetime(Lifetime),

    /// A type argument.
    Type(Type),

    /// A binding (equality constraint) on an associated type: the `Item =
    /// u8` in `Iterator<Item = u8>`.
    Binding(Binding),

    /// An associated type bound: `Iterator<Item: Display>`.
    Constraint(Constraint),

    /// A const expression. Must be inside of a block.
    ///
    /// NOTE: Identity expressions are represented as Type arguments, as
    /// they are indistinguishable syntactically.
    Const(Expr),
}

pub fn parse_separated_nonempty_with(ParseStream,
                                     fn(: ParseStream) -> Result<T>)
-> Result<Self> where P: Token + Parse
